import React from 'react';
import '../App.css'
class Card extends React.Component{
    render(){
        return (
         <div className="item-card">
             <div className="row">
                <div className="col-8 heading">
                    <span className="d-flex">Netflix Account</span>
                </div>
                <div className="col-4">
                   <button class="btn btn-sm btn-outline-success">$21</button>
                </div>
             </div>
             <div>
             <div class="progress" style={{width:"60%",height:"10%"}}>
                <div class="progress-bar progress-bar-striped bg-success" role="progressbar" aria-valuenow="75" aria-valuemin="0" aria-valuemax="100" style={{width: "75%"}}></div>
                </div>
             </div>
        </div>
        );
    }
}

export default Card;
